problem:
Given that

\begin{align*}
\frac{1}{x}+\frac{1}{y}&=5,\\
3xy+x+y&=4,
\end{align*}

compute $x^2y+xy^2$.

Let  \[f(x) =
\begin{cases}
k(x) &\text{if }x>3, \\
x^2-6x+12&\text{if }x\leq3.
\end{cases}
\] Find the function $k(x)$ such that $f$ is its own inverse.

